import React from 'react';
import './HomePage.css';
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import DragonBase from './../../components/Tables/DragonBase'
import HeaderButton from './../../components/Buttons/HeaderButton';
import BaseInput from './../../components/Inputs/BaseInput';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useRouteMatch,
  useParams,
} from 'react-router-dom';
import { useState, useEffect } from 'react';


const headers = [{
    dataField: 'id',
    text:'ID'},{
    dataField:'name',
    text:'ИМЯ'},{
    dataField:'age',
    text:'ВОЗРАСТ'},{
    dataField:'weight',
    text:'ВЕС'},{
    dataField:'character',
    text:'ХАРАКТЕР'},{
    dataField:'type',
    text:'ТИП'},{
    dataField:'x',
    text:'Х'},{
    dataField:'y',
    text:'У'},{
    dataField:'cave',
    text:'ГЛУБИНА ПЕЩЕРЫ'},{
    dataField:'treasure',
    text:'КОЛИЧЕСТВО СОКРОВИЩ'}
];


const rows = [
  {id:'1',name: 'Балерион',age: '208',weight: '10',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
  {id:'2',name: 'Вхагар',age: '181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
  {id:'3',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
  {id:'4',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',y:'4',cave:'1400',treasure:'157'},
  {id:'5',name: 'Мераксес',age:'181',weight: '18',character:'Хаос',type:'Огненный',x:'12',Y:'4',cave:'1400',treasure:'157'},
];

function DragonList() {

  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [items, setItems] = useState([]);

  // Примечание: пустой массив зависимостей [] означает, что
  // этот useEffect будет запущен один раз
  // аналогично componentDidMount()
  useEffect(() => {
      fetch("/dragons")
          .then(res => res.json())
          .then(
              (result) => {
                  setIsLoaded(true);
                  setItems(result);
              },
              // Примечание: важно обрабатывать ошибки именно здесь, а не в блоке catch(),
              // чтобы не перехватывать исключения из ошибок в самих компонентах.
              (error) => {
                  setIsLoaded(true);
                  setError(error);
              }
          )
  }, [])

  if (error) {
      return <div>Ошибка: {error.message}</div>;
  } else if (!isLoaded) {
      return <div>Загрузка...</div>;
  } else {
      return (
          <ul>
              {items.map(item => (
                  <li key={item.id}>
                      {item.title}
                  </li>
              ))}
          </ul>
      );
  }

}

function HomePage()
{
  return (
    <div>
    <main>
    <DragonList/>
    <BootstrapTable 
 keyField='id'
 data={ rows }
 columns={ headers }
 />
    </main>
    <footer>
    <ul className='NeededOperations'>
    <li>
    <BaseInput 
    name="Массив драконов, имя которых начинается с:" 
    enter="Введите подстроку имени"
    />
    </li>
    <li><Link to="/returnarray"><HeaderButton name="Вернуть"/></Link></li>
    </ul>
    <ul className='NeededOperations'> 
    <li>
    <BaseInput 
    name="Количество драконов, характер которых больше:" 
    enter="Введите характер"
    />
    </li>
    <li><Link to='/charactercount'> <HeaderButton name="Вернуть"/></Link> </li>
    </ul>
    <ul className='NeededOperations'>
    <li>
    <BaseInput 
    name="Количество драконов,тип которых меньше:" 
    enter="Введите тип"
    />
    </li>
    <li><Link to='/typecount'> <HeaderButton name="Вернуть"/> </Link></li>
    </ul> 
    </footer>
    </div>
  );
}

export default HomePage;
